import React, {useEffect} from "react";

function Fetch({setClients, setArtists, setShops}){

    useEffect(() => {
        fetch('/clients')
            .then((resp) => resp.json())
            .then(setClients)
    }, [])

    useEffect(() => {
        fetch('/artists')
            .then((resp) => resp.json())
            .then(setArtists)
    }, [])

    useEffect(() => {
        fetch('/shops')
            .then((resp) => resp.json())
            .then(setShops)
    }, [])

    return <></>
}

export default Fetch
